import 'bootstrap/dist/css/bootstrap.min.css';
import styled from 'styled-components';

export const SearchNumContaner = styled.div`
  position: absolute;
  top: 50px; 
  left: 50%;
  transform: translateX(-50%);
  width: 100%;
  max-width: 400px; 
  padding: 20px;
  z-index: 1000; 
`;
